#!/usr/bin/env python3
# -*- coding: utf-8 -*-
import sys

from PyQt5 import QtGui, QtWidgets
from PyQt5.QtWidgets import QMainWindow, QApplication, QFileDialog

import ToolWindow
import base64
import json


class Utils(QMainWindow, ToolWindow.Ui_MainWindow):
    def __init__(self):
        super(Utils, self).__init__()
        self.setupUi(self)
        self.jsonFromatBtn.clicked.connect(self.jsonFromat)
        self.base64ToImgBtn.clicked.connect(self.decodeBase64)
        self.imgToBase64Btn.clicked.connect(self.encodeBase64)
        self.label_img.setScaledContents(True)
        self.cleanBtn.clicked.connect(self.cleanData)

    def jsonFromat(self):
        print("json")
        json_str = self.text_result.toPlainText()
        try:
            json_str = "{'a': 1, 'b': 2}"
            json.loads(json_str)
            js = json.dumps(json_str, sort_keys=True, indent=4, separators=(', ', ': '))
            print(js)
            self.text_result.setPlainText(js)
            return True
        except:
            QtWidgets.QMessageBox.warning(self, "警告", "Json格式不合法")
            return False

    def decodeBase64(self):
        print("decode")
        img_base64_str = self.text_result.toPlainText()
        print("decode", img_base64_str)
        if not img_base64_str.startswith("/9j"):
            QtWidgets.QMessageBox.warning(self, "警告", "图片Base64信息有误")
            return
        imageData = base64.b64decode(img_base64_str)
        with open("temp.png", "wb") as picf:
            picf.write(imageData)

        print("decode", imageData)
        png = QtGui.QPixmap("temp.png")
        print("decode", png)
        self.label_img.setPixmap(png)

    def encodeBase64(self):
        print("encode")
        file_path, file_geshi = QFileDialog.getOpenFileName(self, '选择文件', '', 'Excel files(*.png , *.jpg)')
        print("encode", file_path, file_geshi)
        png = QtGui.QPixmap(file_path)
        self.label_img.setPixmap(png)
        with open(file_path, "rb") as rf:
            result = base64.b64encode(rf.read())
            print(result)
            self.text_result.setPlainText(str(result.decode("utf-8")))

    def cleanData(self):
        print("clean")
        self.text_result.clear()
        self.label_img.clear()


if __name__ == '__main__':
    app = QApplication(sys.argv)

    window = Utils()
    window.show()

    sys.exit(app.exec_())

